import React from "react";
import { DeleteOutline } from "@mui/icons-material";
import { Link } from "react-router-dom";

//home page chart data
export const UserData = [
  {
    name: "Jan",
    ActiveUser: 4000,
  },
  {
    name: "Feb",
    ActiveUser: 3200,
  },
  {
    name: "Mar",
    ActiveUser: 4500,
  },
  {
    name: "Apr",
    ActiveUser: 2900,
  },
  {
    name: "May",
    ActiveUser: 2600,
  },
  {
    name: "Jun",
    ActiveUser: 2300,
  },
  {
    name: "Jul",
    ActiveUser: 2600,
  },
  {
    name: "Aug",
    ActiveUser: 3400,
  },
  {
    name: "Sep",
    ActiveUser: 2500,
  },
  {
    name: "Oct",
    ActiveUser: 1200,
  },
  {
    name: "Nov",
    ActiveUser: 3600,
  },
  {
    name: "Dec",
    ActiveUser: 3300,
  },
];

// the @material/ui table data row
export const rows = [
  {
    id: 1,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$120.00",
  },
  {
    id: 2,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$200.00",
  },
  {
    id: 3,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$170.00",
  },
  {
    id: 4,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$250.00",
  },
  {
    id: 5,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$100.00",
  },
  {
    id: 6,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$300.00",
  },
  {
    id: 7,
    username: "John Snow",
    Avatar: "../../../assets/img/profile.jpg",
    email: "john@gmail.com",
    status: "active",
    transaction: "$380.00",
  },
];

// the @material/ui table data column
export const columns = [
  { field: "id", headerName: "ID", width: 60 },
  {
    field: "user",
    headerName: "username",
    width: 160,
    renderCell: (params) => {
      return (
        <div className="userList">
          <img src={params.row.Avatar} alt="" />
          {params.row.username}
        </div>
      );
    },
  },
  { field: "email", headerName: "Email", width: 200 },
  {
    field: "status",
    headerName: "Status",
    width: 120,
  },
  {
    field: "transaction",
    headerName: "transaction",
    width: 140,
  },
  {
    field: "actions",
    headerName: "Actions",
    width: 100,
    renderCell: (params) => {
      return (
        <>
          <Link to={"/user/" + params.row.id}>
            <button className="userListEdit">Edit</button>
          </Link>
          <DeleteOutline
            className="userListDelete"
            onClick={() => handleDelete(params.row.id)}
          />
        </>
      );
    },
  },
];
